import React from 'react';
import YouTube from 'react-youtube';
import { Container, Row, Col, Card } from "react-bootstrap";

class Video extends React.Component {
  render() {
    const opts = {
      height: '100%',
      width: '100%',
      playerVars: {
        // https://developers.google.com/youtube/player_parameters
        autoplay: 0,
      },
    };


    return (
        <div className="background-video d-flex h-200 vcenter">
        <Container>
            <Row>
                <Col sm>
                <YouTube className="video" videoId="H412fXB1tlU" opts={opts} onReady={this._onReady}  />
                </Col>
                <Col sm>
                <YouTube className="video" videoId="rRypOerIbgU" opts={opts} onReady={this._onReady} />
                </Col>
            </Row>

        </Container>
        </div>



    )
  }

  _onReady(event) {
    // access to player in all event handlers via event.target
    event.target.pauseVideo();
  }
}

export default Video;
